import React from 'react';
import { ChevronDown } from 'lucide-react';
import { RESORT_INFO } from '../utils/constants';
import { scrollToSection } from '../utils/scrollUtils';

const Hero = () => {
  const scrollToNext = () => {
    scrollToSection('#servicios');
  };

  const scrollToContact = () => {
    scrollToSection('#contacto');
  };

  const scrollToGallery = () => {
    scrollToSection('#galeria');
  };

  return (
    <section id="inicio" className="relative h-screen flex items-center justify-center overflow-hidden bg-kawai-sand">
      <div className="absolute inset-0 z-0">
        {/* Imagen de fondo SOLO para móvil */}
        <div className="sm:hidden">
          <img
            src="/images/kawai-aerial-view.jpg"
            alt="Kawai Resort Aerial View"
            className="w-full h-full object-cover"
            loading="eager"
          />
          <div className="absolute inset-0 bg-gradient-to-b from-black/50 via-black/40 to-black/60"></div>
        </div>

        {/* Video de fondo SOLO para tablet y desktop */}
        <div className="hidden sm:block">
          <iframe
            src="https://www.youtube.com/embed/o36HKsDKGAU?autoplay=1&mute=1&loop=1&playlist=o36HKsDKGAU&controls=0&showinfo=0&rel=0&modestbranding=1&playsinline=1&enablejsapi=1&origin=https://kawai-resort.com"
            title="Kawai Resort Video"
            className="w-full h-full object-cover"
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
            loading="lazy"
          />
          <div className="absolute inset-0 bg-black/40"></div>
        </div>
      </div>

      <div className="relative z-20 text-center text-white px-4 sm:px-6 lg:px-8 max-w-4xl mx-auto">
        <h1 className="text-2xl sm:text-3xl md:text-4xl lg:text-5xl xl:text-6xl font-lato font-black mb-3 sm:mb-4 md:mb-6 animate-fade-in leading-tight">
          Bienvenidos a
          <span className="block text-kawai-sun mt-1 sm:mt-2">{RESORT_INFO.name}</span>
        </h1>

        <p className="text-sm sm:text-base md:text-lg lg:text-xl xl:text-2xl mb-4 sm:mb-6 md:mb-8 max-w-2xl mx-auto animate-slide-up font-light leading-relaxed px-2">
          {RESORT_INFO.tagline}
        </p>

        <div className="grid grid-cols-2 sm:flex sm:flex-row gap-3 sm:gap-4 md:gap-6 justify-center items-center animate-slide-up mb-6 sm:mb-8 md:mb-12">
          <button
            onClick={scrollToContact}
            className="w-full bg-gradient-to-r from-kawai-coral to-kawai-sun text-white text-xs sm:text-sm md:text-base px-3 sm:px-4 md:px-6 py-2.5 sm:py-3 md:py-4 rounded-xl sm:rounded-2xl font-bold transition-all duration-300 transform hover:scale-105 hover:shadow-xl shadow-lg border-2 border-kawai-coral/30"
          >
            Reservar
          </button>
          <button
            onClick={scrollToGallery}
            className="w-full bg-white/20 backdrop-blur-md border-2 border-white/50 text-white text-xs sm:text-sm md:text-base px-3 sm:px-4 md:px-6 py-2.5 sm:py-3 md:py-4 rounded-xl sm:rounded-2xl font-bold hover:bg-white hover:text-kawai-deep transition-all duration-300 transform hover:scale-105 shadow-lg"
          >
            Galería
          </button>
        </div>

        <div className="grid grid-cols-3 gap-2 sm:gap-3 md:gap-4 lg:gap-6 xl:gap-8 max-w-2xl mx-auto animate-fade-in">
          <div className="text-center">
            <div className="text-lg sm:text-xl md:text-2xl lg:text-3xl font-bold text-kawai-sun mb-1">50+</div>
            <div className="text-xs sm:text-sm font-medium">Habitaciones</div>
          </div>
          <div className="text-center">
            <div className="text-lg sm:text-xl md:text-2xl lg:text-3xl font-bold text-kawai-sun mb-1">100%</div>
            <div className="text-xs sm:text-sm font-medium">Familiar</div>
          </div>
          <div className="text-center">
            <div className="text-lg sm:text-xl md:text-2xl lg:text-3xl font-bold text-kawai-sun mb-1">24/7</div>
            <div className="text-xs sm:text-sm font-medium">Atención</div>
          </div>
        </div>
      </div>

      <button
        onClick={scrollToNext}
        className="absolute bottom-3 sm:bottom-4 md:bottom-8 left-1/2 transform -translate-x-1/2 z-20 animate-bounce bg-white/10 backdrop-blur-sm rounded-full p-1.5 sm:p-2 md:p-3 hover:bg-white/20 transition-all duration-300"
        aria-label="Scroll down"
      >
        <ChevronDown size={20} className="text-kawai-sun sm:w-6 sm:h-6 md:w-8 md:h-8" />
      </button>
    </section>
  );
};

export default Hero;
